}
interface Exercise {
	duration : number;
	volume : number;
	calories : number;
	ExerciseDate : Date;
};

interface Nutrition {
	Kal : number;
	fat : number;
	carb : number;					
	weight : number;
	protein : number;
	NutritionDate : Date;
};

interface Goal {
	id : number;
	user_id : number;
	createdAt : Date;
	sleep : number;
	water : number;
	sleepDate : Date;								
	waterDate : Date;
	exercise : Exercise;
	nutrition : Nutrition;
}

